import React from "react";
import { XCircle } from "react-feather";

const ComparisonItem = () => {
  return (
    <>
      <div className="item">
        <div className="desc">
          <div className="logo"></div>
          <div className="plan-name"></div>
          <div className="plan-price"></div>
        </div>
        <button>
          <XCircle size={15} />
        </button>
      </div>
    </>
  );
};

export default ComparisonItem;
